import { Switch, Route } from "react-router-dom";

import AuthPage from "./pages/AuthPage";
import DashboardPage from "./pages/DashboardPage";

function App() {
  return (
    <Switch>
      <Route path="/" exact>
        <AuthPage />
      </Route>
      <Route path="/dashboard">
        <DashboardPage />
      </Route>
    </Switch>
  );
}

export default App;
